import React from 'react';

const header = () => {
  return (
    <header>
      <nav>
        <div className="left">Mohit's Portfolio</div>
        <div className="right">
          <ul>
            <li><a href="mohit.html" target="_blank" rel="noopener noreferrer">Home</a></li>
            <li><a href="About.html" target="_blank" rel="noopener noreferrer">About</a></li>
            <li><a href="project.html" target="_blank" rel="noopener noreferrer">Projects</a></li>
            <li><a href="contact.html" target="_blank" rel="noopener noreferrer">Contact</a></li>
          </ul>
        </div>
      </nav>
    </header>
  );
}

export default header;
